import React, { useState } from 'react';
import { View, Text, StyleSheet, ScrollView, TextInput, TouchableOpacity, Image } from 'react-native';
import Fonts from '../Utils/Stylesheet';

const Exponate = () => {
    const [searchText, setSearchText] = useState('');
    return (
        <View style={styles.container}>
            <Text style={Fonts.titleLarge}>Exponate</Text>
            <View style={styles.searchContainer}>
                <TextInput
                    style={styles.searchBar}
                    placeholder="Search Exponate"
                    value={searchText}
                    onChangeText={text => setSearchText(text)}
                />
            </View>
            <ScrollView contentContainerStyle={styles.scrollViewContent}>
                <View style={styles.listHeader}>
                    <Text style={[Fonts.textBoldSmall, styles.column]}>ID</Text>
                    <Text style={[Fonts.textBoldSmall, styles.column]}>Titel</Text>
                </View>
            </ScrollView>
        </View>
    );
};

const styles = StyleSheet.create({
    container: { flex: 1, padding: 20, backgroundColor: '#fff' },
    searchContainer: { marginVertical: 10 },
    searchBar: { borderWidth: 1, borderColor: '#ccc', borderRadius: 5, padding: 8 },
    scrollViewContent: { marginTop: 10 },
    listHeader: { flexDirection: 'row', marginBottom: 5 },
    column: { flex: 1 },
});

export default Exponate;
